import React, { Component } from 'react'
import { Switch } from '@material-ui/core';
export class UseFiltersToggle extends Component {
    render() {
        return (
            <div>
                <Switch value="checkedA"  color='primary'></Switch>
            </div>
        )
    }
}

export default UseFiltersToggle
